import React, {Component} from 'react';

class HomeComponent extends Component {
    render() {
        return (
            <div className="card-style">
            	<h5 className="fancy-title primary-light-font">Objective</h5>
                <div className="objective-sec">
               		<i className="lni-android objective-icon secondary-dark-font"></i>
               		<p>Artistic Software Engineer with 3 year and 9 months of experience including CryptoCurrency Trading, Location Based Blood Request, Social Club Management system and UBER clone apps.</p>
                </div>
                <div className="objective-sec">
                	<i className="lni-android objective-icon secondary-dark-font"></i>
                	<p>Skilled with Solid understanding of full mobile and software development life cycles, UI/UX and Agile Software Development Methodologies.</p>
            	</div>
        	 	<div className="objective-sec">
                	<i className="lni-android objective-icon secondary-dark-font"></i>
                	<p>Experienced in Google Map api integrations and Firebase Realtime Database chating,</p>
            	</div>
            </div>
        )
    }
}

export default HomeComponent
